import React, { Component } from "react";
import "./App.css";
import {Switch, Route} from 'react-router-dom'
import Homepage from './components/Homepage'


class App extends Component {
  state = {
    isSignedIn: false
  }

  render() {
    return (
      <div>
      <nav>
      <Link></Link>
        </nav>
      <Switch>
        <Route exact path="/" render={()=> <Homepage/>}/>
      </Switch>
      </div>
    );
  }
}

export default App;
